DROP DATABASE IF EXISTS web1806;
CREATE DATABASE web1806 CHARSET=UTF8;#apple:utf8mb4
USE web1806;
CREATE TABLE pureshop_user(
	uid  INT PRIMARY KEY AUTO_INCREMENT,
	uname VARCHAR(25),
	upwd VARCHAR(32)
);
CREATE TABLE pureshop_imagelist(
	id INT PRIMARY KEY AUTO_INCREMENT,
	img_url VARCHAR(255),
	title VARCHAR(50)

);
CREATE TABLE pureshop_comments(
	id INT PRIMARY KEY AUTO_INCREMENT,
	nid       INT,
	ctime     DATETIME,
	content   VARCHAR(50),
	username  VARCHAR(25),
	isdel     INT
);
CREATE TABLE pureshop_news(
	id INT PRIMARY KEY AUTO_INCREMENT,
	title VARCHAR(255),
	content VARCHAR(2000),
	click INT,
	img_url VARCHAR(255),
	ctime DATETIME,
	price DECIMAL(10,2)

);
CREATE TABLE pureshop_products(

	wid INT PRIMARY KEY AUTO_INCREMENT,
  type VARCHAR(16),           #所属分类 
  title VARCHAR(128),         #标题
  price DECIMAL(10,2),        #价格
  score DECIMAL(2,1),          #评分
  sold_count INT,             #累积销量
  stock VARCHAR(64),          #库存
  show_pic VARCHAR(128),          #展示图片路径
  lg1 VARCHAR(128),           #大图片路径
  lg2 VARCHAR(128),
  lg3 VARCHAR(128),
  lg4 VARCHAR(128),
  lg5 VARCHAR(128),            
  md1 VARCHAR(128),          #中图片路径   
  md2 VARCHAR(128),            
  md3 VARCHAR(128),            
  md4 VARCHAR(128),            
  md5 VARCHAR(128),            
  sm1 VARCHAR(128),           #小图片路径
  sm2 VARCHAR(128),            
  sm3 VARCHAR(128),            
  sm4 VARCHAR(128),            
  sm5 VARCHAR(128),
  xg1 VARCHAR(128),          #效果图
  xg2 VARCHAR(128)
);

CREATE TABLE cart_list(

	cid INT PRIMARY KEY AUTO_INCREMENT,
	wid INT,
	title VARCHAR(128),
	username VARCHAR(16),
	num INT,
	price INT,
	pic VARCHAR(128)

);






